import React, { useEffect } from "react";
import AdminSidebar from "../../components/sidebars/adminSidebar";
import "../background.css";
import {
    Stack,
    Typography,
    FormControl,
    OutlinedInput,
    InputAdornment,
    IconButton,
    InputLabel,
    Dialog,
    DialogActions,
    DialogTitle,
    DialogContent,
    DialogContentText, // Ensure this is imported
    Button,
    Slide,
} from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import SearchIcon from "@mui/icons-material/Search";

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

function RevokeAccessPage() {
    const [searchQuery, setSearchQuery] = React.useState("");
    const [retailers, setRetailers] = React.useState([]);
    const [dataOpen, setDataOpen] = React.useState(false);

    async function getRetailers() {
        const token = localStorage.getItem("token");
        try {
            const inputs = { name: searchQuery };
            const response = await fetch(
                "http://localhost:5000/access/getListOfRetailers",
                {
                    method: "POST",
                    headers: {
                        jwt_token: token,
                        "Content-type": "application/json",
                    },
                    body: JSON.stringify(inputs),
                }
            );
            const parseRes = await response.json();
            let tempRows = [];
            parseRes.map((pr) => {
                tempRows.push({
                    id: pr.r_id,
                    Retailer_Name: pr.r_name,
                    Mobile_Number: pr.r_mobile_num,
                });
            });
            setRetailers(tempRows);
        } catch (err) {
            console.error(err);
        }
    }

    useEffect(() => {
        getRetailers();
    }, [searchQuery]);

    const columns = [
        { field: "id", headerName: "Retailer_ID", width: 500 },
        {
            field: "Retailer_Name",
            headerName: "Retailer_Name",
            width: 300,
        },
        {
            field: "Mobile_Number",
            headerName: "Mobile_Number",
            width: 400,
        },
    ];

    const handleDataOpen = () => {
        setDataOpen(true);
    };

    const handleDataClose = () => {
        setDataOpen(false);
    };

    async function handleDeletion() {
        const token = localStorage.getItem("token");
        const r_id = localStorage.getItem("id");
        try {
            const inputs = { r_id: r_id };
            const response = await fetch(
                "http://localhost:5000/access/handleRetailerDeletion",
                {
